var Userpanel = function () {
	this.TAG = 'Userpanel => ';
	this.user = null;
	this.template = 'userpanel.html';
}

Userpanel.prototype.setUser = function(user) {
	if(this.user === null)
		this.user = user;
};

Userpanel.prototype.open = function() {
	if(!this.user.isLoggedIn()) {
		$.mobile.changePage('#login');
		return;
	}

	var self = this;
	$('#userpanel .ui-content').load('content/' + this.template, function () {
		$('#ranking-tbl-wrapper').hide();

		self.renderUserInformation($(this));
		self.requestRankInformation();
		self.setEventHandler();

		if(!self.user.isClassQuizDone()) {
			$('#userpanel .hint-quiz').show();
		}

		$(this).enhanceWithin();
	});
};

Userpanel.prototype.renderUserInformation = function(uiContainer) {
	var user = this.user.getCurrentUser();

	$(uiContainer).find('#user-username').text(user.username);
	$(uiContainer).find('#user-firstname').text(user.firstname);
	$(uiContainer).find('#user-lastname').text(user.lastname);
	$(uiContainer).find('#user-email').text(user.email);
	$(uiContainer).find('#name-helper').text(user.lastname + ', ' + user.firstname);
};

Userpanel.prototype.requestRankInformation = function() {
	var self = this,
		request = $.ajax({
			url: BaseRequestUrl + '/ranks',
			type: 'GET',
			dataType: 'json'
		});

	request.done(function (response) {
		if(response.error) {
			alert(response.message);
			return;
		}

		var ranks = response.ranks;
		self.setUserCurrentRank(ranks);
		self.buildDetailedRankInfo(ranks);
	});

	request.fail(function (jqXHR, status) {
		console.log(self.TAG + 'Error | Status: ' + status + '; jqXHR: ' + JSON.stringify(jqXHR));
	});
};

Userpanel.prototype.setUserCurrentRank = function(availableRanks) {
	var rankSelector = $('#userpanel .ui-content').find('#user-rank'),
		rankHelperSelector = $('#userpanel .ui-content').find('#rank-helper');

	if(!this.user.isClassQuizDone()) {
		$(rankSelector).text('"noch nicht eingestuft"');
		return;
	}

	var self = this,
		userRank = $.grep(availableRanks, function (rank) { return rank.id === self.user.getCurrentRankId(); })[0];
	$(rankSelector).text(userRank.rank + ' (' + userRank.category + ')');
	$(rankHelperSelector).html('den Rang <b>' + userRank.rank + ' (' + userRank.category + ')</b> erreicht hat.');
	$('#rank-2').text(userRank.rank + ' (' + userRank.category + ') ');
};

Userpanel.prototype.setEventHandler = function() {
	var self = this;

	$('#show-complete-ranking-btn').on('click', function() {
		var uiContainer = $('#ranking-tbl-wrapper');
		$(uiContainer).toggle();

		if($(uiContainer).is(':visible'))
			$(this).text('Rangsystem ausblenden');
		else
			$(this).text('Rangsystem einblenden');
	});

	$('#cert-dl-btn').on('click', function (event) {
		event.preventDefault();
		self.createCertPdf();
	});

	$('#logout-btn').on('click', function (event) {
		event.preventDefault();
		app.loginHandler.logout();
		$.mobile.changePage('');
	});
};

Userpanel.prototype.createCertPdf = function() {
	var doc = new jsPDF('p', 'cm', 'a4', false);

	var imgMexicanGuy = 'data:image/jpeg;base64,',
		imgCertSign = 'data:image/jpeg;base64,';

	var firstname = $('#user-firstname').text(),
		lastname = $('#user-lastname').text(),
		pointToCentimeter = 0.0352777778,
		pixelToCentimeter = 0.0264583333333334;

	var leftPaddingName = (21 - ($('#name-helper').width() * pixelToCentimeter)) / 2,
		rightPaddingName = leftPaddingName + ($('#name-helper').width() * pixelToCentimeter),
		leftPaddingRankFirst = (21 - ($('#rank-helper').width() * pixelToCentimeter)) / 2,
		leftPaddingRankMiddle = leftPaddingRankFirst + ($('#rank-1').width() * pixelToCentimeter),
		leftPaddingRankLast = leftPaddingRankMiddle + ($('#rank-2').width() * pixelToCentimeter);

	doc.setFont('times');
	doc.setFontSize(72);
	doc.setFontStyle('bold');
	doc.text(5.2, 3.9, 'Zertifikat');
	doc.setFontStyle('normal');
	doc.setFontSize(36);
	doc.text(4.9, 6.4, 'von Cocina Mexicana');
	doc.setFontSize(20);
	doc.text(6.1, 9.4, 'Hiermit bescheinigen wir, dass');
	doc.text(leftPaddingName, 10.9, lastname + ', ' + firstname);
	doc.setLineWidth(0.05);
	doc.line(leftPaddingName, 11, rightPaddingName, 11);
	doc.text(leftPaddingRankFirst, 12.4, 'den Rang');
	doc.setFontStyle('bold');
	doc.text(leftPaddingRankMiddle, 12.4, $('#user-rank').text());
	doc.setFontStyle('normal');
	doc.text(leftPaddingRankLast, 12.4, ' erreicht hat.');
	doc.addImage(imgMexicanGuy, 'JPEG', 6.4, 14.6, 8.1, 9);
	doc.addImage(imgCertSign, 'JPEG', 2.5, 24.6, 7.2, 1.3);
	doc.setLineWidth(0.05);
	doc.line(2.5, 26, 9.7, 26);
	doc.setFontSize(16);
	doc.text(2.5, 26.7, 'Team Cocina Mexicana');

	doc.save('certficate-cocina-mexicana.pdf');
};

Userpanel.prototype.buildDetailedRankInfo = function(availableRanks) {
	var rankTableBody = $('#ranking-tbl').find('tbody');
	availableRanks.forEach(function (item, index) {
		var tblRow =
			'<tr>' +
			'<td>' + item.rank + '</td>' +
			'<td>' + item.category + '</td>' +
			'<td>' + item.promotion_criterions + ' Rezepte</td>' +
			'</tr>';
		$(rankTableBody).append(tblRow);
	});
};